```json
{
  "application": "Slurm",
  "details": {
    "scheduler": "Slurm",
    "queue": "small",
    "nodes": 1,
    "tasks": 1,
    "runtime": "05:00:00",
    "project": "ASC21002",
    "environment": {
      "conda": "rap"
    },
    "python_script": "dask_process.py",
    "python_arguments": "-workers ${work} -time ${size} -n ${n}"
  }
}
```

This script is running within the **Slurm** workload manager. It requests resources from the Slurm scheduler and runs the python script "dask_process.py" with specified arguments using the conda environment "rap".
